import logo from './logo.svg';
import './App.css';
import Navbar from './Components/Navbar';
import { ChakraProvider } from '@chakra-ui/react'
import {
  Box,
  Flex,
  Avatar,
  HStack,
  Link,
  IconButton,
  Button,
  Menu,
  MenuButton,
  MenuList,
  MenuItem,
  MenuDivider,
  useDisclosure,
  useColorModeValue,
  Stack,
  Image,
  Text,
} from '@chakra-ui/react';

function App() {
  return (

   <ChakraProvider>
     <Navbar/>
     <>
     <Box bg='#BACEC1' w='100%'>
     <Text fontSize='5xl' color='white'>" Mental heatlh at it's eaze "</Text>
     <Box
  as='button'
  height='24px'
  lineHeight='1.2'
  transition='all 0.2s cubic-bezier(.08,.52,.52,1)'
  border='1px'
  px='8px'
  borderRadius='xl'
  fontSize='14px'
  fontWeight='semibold'
  bg='#1D3124'
  borderColor='#ccd0d5'
  color='white'
  _hover={{ bg: '#ebedf0' }}
  _active={{
    bg: '#dddfe2',
    transform: 'scale(0.98)',
    borderColor: '#bec3c9',
  }}
  _focus={{
    boxShadow:
      '0 0 1px 2px rgba(88, 144, 255, .75), 0 1px 1px rgba(0, 0, 0, .15)',
  }}
>
  Book a Demo
</Box>
    </Box>
     </>
     </ChakraProvider>
  );
}

export default App;
